import React from 'react';
import './App.css';
import Data from './colleges.json'

function App() {
  return (
    <div className="App">

        { Data.map((post,index) => {
          return index (
            <>
              <h1>{post.discount}</h1>
            </>
          )
        })}
      </div>

  );
}

export default App;
